import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const ImageSlider = () => {
  let settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slideToShow: 1,
    slideToScroll: 1,
    autoplay: true,
  };
  return (
    <div className="bg-red-500 px-12">
      <Slider {...settings} className="container slider mx-auto">
        <div className="wrap">
          <a href="../../assets">
            <img src="" alt="" />
          </a>
        </div>
        <div className="wrap">
          <a href="/">
            <img src="" alt="" />
          </a>
        </div>
        <div className="wrap">
          <a href="/">
            <img src="" alt="" />
          </a>
        </div>
      </Slider>
    </div>
  );
};

export default ImageSlider;
